An individual with a disability is a person who: (1) has a physical or
                mental impairment that substantially limits one or more major life activities;
                OR (2) has a record of such impairment; OR (3) is regarded as having such impairment.

Un individuo con una discapacidad es una persona que: (1) tiene un físico o
                deterioro mental que limita sustancialmente una o más actividades importantes de la vida;
                O (2) tiene un registro de dicho impedimento; O (3) se considera que tiene tal impedimento.
